import { useState } from "react";
import NavBar from "./NavBar";

function NavBarMenu() {
  const [open, setOpen] = useState(false);

  const handleClick = () => {
    setOpen(!open);
  };

  return (
    <NavBar></NavBar>
  );
}

export default NavBarMenu;
